import 'package:schoolworkspro_app/api/api.dart';import '../../response/my_achievements_response.dart';class AchievementsRepository {  API api = API();  Future<MyAchievementResponse> getMyAchievements() async {    API api = new API();    dynamic response;    MyAchievementResponse res;    try {      response = await api.getWithToken('/achievements/mine');      print(response);      res = MyAchievementResponse.fromJson(response);    } catch (e) {      res = MyAchievementResponse.fromJson(response);    }    return res;  }}